import React from "react";
import styled from "styled-components";
// css
const HeaderContaner = styled.div`
  background: red;
  margin: auto 0;
  ${"" /* text-align: center; */}
`;

function Header() {
  return (
    <HeaderContaner>
      <h2>Gurules</h2>
      <ul>
        <li>About</li>
        <li>Find Tutor</li>
        <li>Contact</li>
        <li>Dashboard</li>
        <li>Login</li>
      </ul>
    </HeaderContaner>
  );
}

export default Header;
